export default function Login() {
  // function submitHandler() {}
  return (
    <div className="Login">
      <form>
        <label>
          Name:
          <input type="text" name="username" />
        </label>

        <label>
          Password:
          <input type="password" name="password" />
        </label>
        <input type="submit" value="Submit" />
      </form>
    </div>
  );
}
